        console.log(graphSeg, amount, startPerc);


        return {background: `linear-gradient(to right, rgba(34,193,195,1) 25%, rgba(171,215,77,1) 25%, rgba(171,215,77,1) 75% ,rgba(253,187,45,1) 75%)`}
    }

    // createGraph()

